import React from "react";

export const About = () => {
  return (
    <div className="bg-white rounded-lg shadow-lg overflow-hidden w-120 mx-auto">
      <div className="p-6">
        <h2 className="text-xl font-semibold text-gray-800 mb-2">About Us</h2>
        <p className="text-gray-600">
          Welcome to the Career Services and Industrial Liaison Office Portal of
          FAST National University Karachi, your trusted gateway to career
          success! Here, we are passionate about connecting talented individuals
          with their dream careers and empowering organizations to find the
          perfect fit for their teams. Our Mission Our mission is simple: to
          bridge the gap between job seekers and employers, fostering mutually
          beneficial connections that lead to personal and professional growth.
          We're committed to helping job seekers find meaningful employment
          opportunities that align with their skills, goals, and values.
          Simultaneously, we assist employers in identifying top talent to drive
          their businesses forward. Whether you're taking the first step on your
          career journey or looking to take it to the next level, FAST National
          University Career Services and Industrial Liaison Office is here to
          support you every step of the way. Thank you for choosing us as your
          partner in career growth. We look forward to helping you achieve your
          aspirations and connect you with the opportunities that will shape
          your future. Ready to embark on your career journey with us? [Sign Up
          / Log In] today!
        </p>
      </div>
    </div>
  );
};

